import "./App.css";
import React, { useEffect } from "react";
import { Routes, Route, Navigate } from "react-router-dom";
import { useDispatch, useSelector } from "react-redux";
import { LoginPages, HomePages } from "./pages";
// import jwt_decode from "jwt-decode";
// import { getCookie } from "../../utils/cookies";

function App() {
  const { authReducersResult } = useSelector((state) => state.authReducers);
  const dispatch = useDispatch();

  useEffect(() => {
    if (authReducersResult == null) {
     return <Navigate to="/" />
    }
  }, [authReducersResult, dispatch]);

  return (
    <div>
      {authReducersResult ? <Navigate to="/" /> : <Navigate to="/login" />}
      <Routes>
        <Route path="/" element={<HomePages />} />
        <Route path="/login" element={<LoginPages />} />
      </Routes>
    </div>
  );
}

export default App;
